this image mosaic made up of images acquired by the high resolution stereo camera (hrsc) on board esa's mars express spacecraft shows the well-preserved korolev crater on mars, which is filled with water ice all year round.
the crater floor, which lies two kilometres beneath the korolev crater rim, is covered in a 1800-metre deposit of water ice all year round. the domed ice forms a glacier comprising around 2200 cubic kilometres of non-polar ice on mars. that is about 50 times the volume of lake constance and is comparable in size to the canadian great bear lake.
